def wordToText(wordList):
    """
    Remove bbox info, get array of just text
    """
    textLines = []
    for i in wordList:
        textLines.append([])
        for j in i:
            textLines[-1].append(j.text)
    return textLines


def getRelevantLines(allLines, minRequiredColumns=MIN_REQUIRED_COLUMNS):
    """
    Requiring low amount of columns (1-2) will pick up unrelated table data
    """
    tempLines = []
    for i in allLines:
        if(len(i) >= minRequiredColumns):
            tempLines.append(i)
    return tempLines


def makeLines(sortedWords):
    lines = []
    # print("$$$ By Line $$$")
    for i in range(len(sortedWords)):
        if(i == 0):
            lines.append([])
            lines[0].append(sortedWords[i])
            continue
        elif(not Word.checkSameLine(sortedWords[i-1], sortedWords[i])):
            lines.append([])
        lines[-1].append(sortedWords[i])
    return lines


def fillEmptyColumns(lines, headerIndex):
    newLines = []
    for i in range(headerIndex, len(lines)):
        # go through all words in a specific line
        columnIndexToWord = {}
        newLine = []
        for j in range(len(lines[i])):
            # compare the words to every word in the header column
            for k in range(len(lines[headerIndex])):
                if(Word.checkSameColumn(lines[headerIndex][k], lines[i][j])):
                    columnIndexToWord[k] = lines[i][j]
                    break  # break so if there is a 'bad' word that covers multiple columns, only put it in first occurence
        #     print()
        # for k, v in columnIndexToWord.items():
        #     print(str(k) + " => " + str(v))

        for x in range(len(lines[headerIndex])):
            if(x in columnIndexToWord):
                newLine.append(columnIndexToWord[x])
            else:
                newLine.append(Word("<EMPTY>", 0, 0, 0, 0))
        newLines.append(newLine)
    return newLines


def getHeaderRowIndex(arrLines):
    maxIndex = 0
    maxLength = 0
    for i in range(len(arrLines)):
        if(len(arrLines[i]) > maxLength):
            maxIndex = i
            maxLength = len(arrLines[i])
    return maxIndex


def writeToFile(path, text, mode='a'):
    f = open(path, mode)
    f.write(text)


def parseTreeByWord(tree):
    """
    get all the words from the ocr output
    """
    words = []
    for node in tree.iter():
        if('class' in node.attrib):
            cl = ocr_ops.getClass(node)
            if(cl == "ocrx_word"):
                text = ocr_ops.getText(node)
                bbox = ocr_ops.getBoundingBox(node)
                word = Word(text, bbox[0], bbox[1], bbox[2], bbox[3])
                words.append(word)
    return words


def sortMergedWords(words):
    """
    Once the words have been merged horizontally and vertically, make sure they are sorted correctly. swap words as needed
    """
    sortedWords = sorted(words, key=lambda x: (x.posTop, x.posLeft))
    for i in range(len(sortedWords)):
        curWord = sortedWords[i]
        for j in range(i, -1, -1):
            checkWord = sortedWords[j]
            if(curWord == checkWord):
                continue
            curIndex = sortedWords.index(curWord)
            checkIndex = sortedWords.index(checkWord)
            if(Word.checkSameLine(curWord, checkWord) and (curWord.posLeft < checkWord.posLeft and curIndex > checkIndex)):
                # curIndex = sortedWords.index(curWord)
                # checkIndex = sortedWords.index(checkWord)
                sortedWords.insert(checkIndex, sortedWords.pop(curIndex))

    return sortedWords


def swapWords(words, index1, index2):
    return words[index2], words[index1]


def mergeByWord(originalWords, direction):
    """
    Will go through all words and merge those that are close (based on specified distance)
    Will merge Horizontally (0) or Vertially (1) depending on the input
    """
    if(direction == 0):
        words = sorted(originalWords, key=lambda x: int(x.posLeft))
    elif(direction == 1):
        words = sorted(originalWords, key=lambda x: int(x.posTop))
    # words Index => newWords Index
    mergeDict = {}
    newWords = []
    mergeCount = 0
    for i in range(len(words)):
        for j in range(len(words)):
            if(words[i] == words[j]):
                continue
            mergeSuccessful = False
            if(direction == 0):
                mergeSuccessful = Word.tryMergeHorizontal(
                    words[i], words[j], HORIZONTAL_MERGE_DIST)
            elif(direction == 1):
                mergeSuccessful = Word.tryMergeVertical(
                    words[i], words[j], VERTICAL_MERGE_DIST)
            if(mergeSuccessful):
                if(i in mergeDict):
                    newWord = Word.mergeWords(newWords[mergeDict[i]], words[j])
                    newWords[mergeDict[i]] = newWord
                    mergeDict[j] = mergeDict[i]
                else:
                    newWord = Word.mergeWords(words[i], words[j])
                    newWords.append(newWord)
                    mergeDict[i] = len(newWords)-1
                    mergeDict[j] = len(newWords)-1
                mergeCount += 1
                break
        if(i not in mergeDict):
            newWords.append(words[i])
    if(direction == 0):
        print("Horizontal Merges: " + str(mergeCount))
    if(direction == 1):
        print("Vertical Merges: " + str(mergeCount))
    return newWords


